import React ,{useEffect , useState} from 'react'
import { useParams } from "react-router-dom";
import axios from 'axios';
import { CircularProgress } from '@material-ui/core';

function Todo() {
  const {id} = useParams();
  const [TodoDetails, SetTodoDetails] = useState({})

  useEffect(() => {
    axios.get(`http://localhost:8000/api/todos/${_id}`).then((res) => {
      const responseTodos = res.data;
      SetTodoDetails(responseTodos);
    })
  }, [])
  console.log(TodoDetails);
  const {_id :todoId ,userId , title , completed}= TodoDetails || {};

  return (
    <div>
      {
        TodoDetails ? (<div> 
          <h1>{`todo_id :${todoId}`}</h1>
          <h1>{`user_id :${userId}`}</h1>
          <h1>{`title :${title}`}</h1>
          <h1>{`Is_completed :${completed}`}</h1>

        </div>)
        : <CircularProgress/>
      }
    </div>
  )
}

export default Todo;
